from flask import Flask
import random

app = Flask(__name__)

@app.route("/")
def mainPage():
    return "<h1><h1>"

@app.route("/random_fact")
def randomFact():
    facts = [0,1,2,3,4,5,6,7]
    facts[0] = "Большинство людей, страдающих технологической зависимостью, испытывают сильный стресс, когда они находятся вне зоны покрытия сети или не могут использовать свои устройства."
    facts[1] = "Согласно исследованию, проведенному в 2018 году, более 50% людей в возрасте от 18 до 34 лет считают себя зависимыми от своих смартфонов."
    facts[2] = "Изучение технологической зависимости является одной из наиболее актуальных областей научных исследований в настоящее время."
    facts[3] = "Согласно исследованию, проведенному в 2019 году, более 60% людей отвечают на рабочие сообщения в своих смартфонах в течение 15 минут после того, как они вышли с работы."
    facts[4] = "Один из способов борьбы с технологической зависимостью - это поиск занятий, которые приносят удовольствие и улучшают настроение."
    facts[5] = "Илон Маск утверждает, что социальные сети созданы для того, чтобы удерживать нас внутри платформы, чтобы мы тратили как можно больше времени на просмотр контента."
    facts[6] = "Илон Маск также выступает за регулирование социальных сетей и защиту личных данных пользователей. Он утверждает, что социальные сети собирают огромное количество информации о нас, которую потом можно использовать для манипулирования нашими мыслями и поведением."
    facts[7] = "Социальные сети имеют как позитивные, так и негативные стороны, и мы должны быть более осознанными в использовании этих платформ."
    randomfact = random.choice(facts)
    return f"<h1>{randomfact}</h1>"

@app.route("/coin")
def coin():
    chance = random.randint(1,2)
    if chance == 1:
        return""" <h1>РЕШКА</h1>
                  <img src="data:image/jpeg;base64,">
        """
    else:
        return"""<h1>ОРЕЛ</h1>
                 <img src="data:image/jpeg;base64,">
        """


app.run(debug=True)